p;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"398377","type":"CustomJS"},{"attributes":{"fill_color":{"field":"inc","transform":{"id":"398027"}},"hatch_color":{"field":"inc","transform":{"id":"398027"}},"line_color":{"field":"inc","transform":{"id":"398027"}},"top":{"field":"Volume"},"width":{"value":0.8},"x":{"field":"index"}},"id":"398264","type":"VBar"},{"attributes":{"logo":null,"toolbars":[{"id":"398057"},{"id":"398203"},{"id":"398017"},{"id":"398254"},{"id":"398345"}],"tools":[{"id":"398049"},{"id":"398050"},{"id":"398051"},{"id":"398052"},{"id":"398053"},{"id":"398054"},{"id":"398055"},{"id":"398078"},{"id":"398378"},{"id":"398195"},{"id":"398196"},{"id":"398197"},{"id":"398198"},{"id":"398199"},{"id":"398200"},{"id":"398201"},{"id":"398224"},{"id":"398226"},{"id":"398378"},{"id":"398009"},{"id":"398010"},{"id":"398011"},{"id":"398012"},{"id":"398013"},{"id":"398014"},{"id":"398015"},{"id":"398375"},{"id":"398378"},{"id":
